import axios from 'axios';
import React, { useEffect, useState } from 'react';
import catalogoList from '../../global/requisicoes.js'

import Header from '../Header.js'
import SectionSobre from './SectionSobre.js'

import CardCafe from './CardCafe.js'

import fotoSobre from '../../img/fotoSobre.svg'
import facebook from '../../img/facebook.svg'
import twitter from '../../img/twitter.svg'
import linkedin from '../../img/linkedin.svg'
import instagram from '../../img/instagram.svg'
import { Component } from 'react';

function Home() {

   return (
      <div className="Home">
         <Header />
         <div className='fundoHome'></div>

         <SectionSobre />

         <section className='slideCatalogo'>
            {data.map(data => {
               return <CardCafe
                  key={data.id}
                  nome={data.nome}
                  desc={data.descricao}
                  fotoURL={data.fotoURL}
                  id={data.id} />
            })}
         </section>
      </div>
   )
}

export default Home
